import React from 'react';
import { Link } from 'react-router-dom'
import { Container } from '../CaixaCentral/styled';
import { connect } from 'react-redux'

function CaixaCentral({ dadosPros }) {

  console.log('dadosPros', dadosPros)
  return (
    <Container>

      <>
        <h1 class="titulo">sdfsdfsdf</h1>
        <h3 class="descricao">sdfsdfsd</h3>
        <span class="preco">R$2000</span>
      </>

    </Container>
  )
}

export default connect(state => ({
  dadosPros: state.cart
}))(CaixaCentral);
